## SCHEMA MAPPING PURPOSE DESCRIPTION
Analyse call transcript to extract potential opportunities, cases based on complaints, request or compliments as well as creating follow up tasks.

## SCHEMA MAPPING JSON OUTPUT FORMAT
{
  "records" : [ {
    "Cases" : {
      "records" : [ {
        "Subject" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The subject for the case[/PURPOSE]}}",
        "Description" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32000[/DATA_LENGTH][PURPOSE]A short case description[/PURPOSE]}}",
        "attributes" : {
          "purposeDescription" : "If the customer has any request or complaint, create a new case. There can be more than one case",
          "referenceId" : "[Replace with the referenceId]",
          "type" : "Case"
        }
      } ]
    },
    "Tasks" : {
      "records" : [ {
        "Subject" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]A short subject what the task is about[/PURPOSE]}}",
        "Description" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32000[/DATA_LENGTH][PURPOSE]A description of the task, add enough detail but dont go overboard[/PURPOSE]}}",
        "ActivityDate" : "{{[DATA_TYPE]Date[/DATA_TYPE][DATA_LENGTH]0[/DATA_LENGTH][PURPOSE]The date / time the action takes place[/PURPOSE]}}",
        "attributes" : {
          "purposeDescription" : "If the call contains any actions that have a clear date (can be an actual date or something like, next week, in three weeks etc) create an actionable task.",
          "referenceId" : "[Replace with the referenceId]",
          "type" : "Task"
        }
      } ]
    },
    "Id" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]Map this to the input account Id, this is an 18 character salesforce id that will be specified in the prompt[/PURPOSE]}}",
    "agentforce1__External_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]Extract the account number that is provided by the customer and put that number in this field. An example account number looks like:\r\nACC-00000000[/PURPOSE]}}",
    "attributes" : {
      "purposeDescription" : null,
      "referenceId" : "[Replace with the referenceId]",
      "type" : "Account"
    }
  } ]
}

