## SCHEMA MAPPING PURPOSE DESCRIPTION
Extracting a business process from a flowchart into a data structure containing a process object and a process step object that are linked together.

## SCHEMA MAPPING JSON OUTPUT FORMAT
{
  "records" : [ {
    "ContentDocumentLinks" : {
      "records" : [ {
        "ContentDocumentId" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]Populate this field with the Content Document File Id from the input file of the prompt template. This is the Salesforce Id and not a refId.[/PURPOSE]}}",
        "attributes" : {
          "purposeDescription" : "test",
          "referenceId" : "[Replace with the referenceId]",
          "type" : "ContentDocumentLink"
        }
      } ]
    },
    "agentforce1__Steps__r" : {
      "records" : [ {
        "agentforce1__Outcomes1__r" : {
          "records" : [ {
            "agentforce1__Next_Step__c" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]The is the lookup reference to the next step in the process. Populate this field with the matching refId of the next step[/PURPOSE]}}",
            "agentforce1__Process__c" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]A lookup field to the parent Process__c record. Apply the refId accordingly[/PURPOSE]}}",
            "agentforce1__Step__c" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]A lookup to the parent step record. Populate with the parent refId[/PURPOSE]}}",
            "agentforce1__Step_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The name of the parent step formatted like \"SP_xxxx\" to link this outcome to a step[/PURPOSE]}}",
            "agentforce1__Next_Step_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]the Id of the next step, required for decision. This is formatted like PS_xxxx[/PURPOSE]}}",
            "agentforce1__Process_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The Id of the parent process. Formatted like 'PROC_xxxx' this field is to match it all up the \"ultimate\" parent so to speak[/PURPOSE]}}",
            "agentforce1__Condition__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The value of the condition, required for decision.[/PURPOSE]}}",
            "attributes" : {
              "purposeDescription" : "This list of outcomes is added as a child of the process steps when the type is decision. When a decision is made there are multiple outcomes. Outcomes.",
              "referenceId" : "[Replace with the referenceId]",
              "type" : "agentforce1__Outcome__c"
            }
          } ]
        },
        "agentforce1__Next_Step__c" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]The is the lookup reference to the next step in the process. Populate this field with the matching refId of the next step[/PURPOSE]}}",
        "agentforce1__Next_Step_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]Field containing the Id of the next action, only applies when the type field is \"Process\". There is no next step when the type is \"End\" or \"Decision\"[/PURPOSE]}}",
        "agentforce1__Actor__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]If you can find any logical actor, the actor value goes in here[/PURPOSE]}}",
        "agentforce1__Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The unique id of this step formatted like 'PS_xxxx' use padding with zeroes for the number that is represented by the 4x[/PURPOSE]}}",
        "agentforce1__Actor_Role__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The role of the actor if you can find it, Human, Agent, System etc. Be consistent and don't overcomplicate it[/PURPOSE]}}",
        "agentforce1__Process_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The Unique Process Id of the parent formattted like 'PROC_xxxx' or if there is a clear process Id in the flow use that one. Match it to the parent value.[/PURPOSE]}}",
        "agentforce1__Action__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The action value and or action description, whatever is availible / makes sense. It will usually be the name.[/PURPOSE]}}",
        "agentforce1__Type__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]Valid values are \"Process\", \"Decision\" or \"End\" depending on the type of process[/PURPOSE]}}",
        "attributes" : {
          "purposeDescription" : "This object contains all information relating a step in a business process. There are different types of steps: Start, Process, Decision and End.",
          "referenceId" : "[Replace with the referenceId]",
          "type" : "agentforce1__Step__c"
        }
      } ]
    },
    "agentforce1__Start_Step__c" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]This field is a reference field that is the lookup to first step in the analysed process. This is where the process starts.[/PURPOSE]}}",
    "Name" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]80[/DATA_LENGTH][PURPOSE]The name of the process. If there is a clear title use this tile. If not make up a title based on the file name and or what makes sense from the entire context of the process.[/PURPOSE]}}",
    "agentforce1__AI_Model__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The AI Model Used to extract the process. This is a system field and will be specified. Ignore this for the process extraction as it is not relevant.[/PURPOSE]}}",
    "agentforce1__Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The Unique Process Id. If on the process you can find a clear process Id populate that here. If you cannot find any specific process Id format the process like 'PROC_xxxx' and for each process up the number. Pad the value with zeroes on the left.[/PURPOSE]}}",
    "agentforce1__Version__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]{If you can find a version, apply the version else default the version to 1.0}[/PURPOSE]}}",
    "agentforce1__Start_Step_Id__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]The (external) Id that is generated for the start step. This creates the link based on the external id and is not an id in the technical sense.[/PURPOSE]}}",
    "agentforce1__Notes__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]100000[/DATA_LENGTH][PURPOSE]A list of notes where you can put feedback or any errors. It could be that the flow chart is invalid, missing items, infinity loops etc. If you run into these issues put them in here.[/PURPOSE]}}",
    "agentforce1__Description__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]A short description of the process[/PURPOSE]}}",
    "agentforce1__Summary__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]100000[/DATA_LENGTH][PURPOSE]A summary of the process in a few lines used to find the process by users through AI search. So make this contain the items a user would search for to find the process easily[/PURPOSE]}}",
    "attributes" : {
      "purposeDescription" : "This objects contains all the generic metadata related a business process. Things like the name, version etc.",
      "referenceId" : "[Replace with the referenceId]",
      "type" : "agentforce1__Process__c"
    }
  }, {
    "WhatId" : "{{[DATA_TYPE]REFERENCE[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]This is a lookup to the process. Populate this with the process RefId accordingly[/PURPOSE]}}",
    "Subject" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]Fill this value with: Review Process Task + The name of the process[/PURPOSE]}}",
    "Description" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32000[/DATA_LENGTH][PURPOSE]The task should be a process review task. Put a note in here to review the newly extracted process[/PURPOSE]}}",
    "ActivityDate" : "{{[DATA_TYPE]Date[/DATA_TYPE][DATA_LENGTH]0[/DATA_LENGTH][PURPOSE]Create the data one week from now[/PURPOSE]}}",
    "attributes" : {
      "purposeDescription" : null,
      "referenceId" : "[Replace with the referenceId]",
      "type" : "Task"
    }
  } ]
}

## SCHEMA MAPPING PURPOSE DESCRIPTION
Analyse a shopping list and extract allergy information, price information and other receipt information.

