      "records" : [ {
        "agentforce1__Reason_for_confidence_score__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32768[/DATA_LENGTH][PURPOSE]Give a detailed reason on why you gave the product confidence score[/PURPOSE]}}",
