    "agentforce1__Recipe_Idea__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32768[/DATA_LENGTH][PURPOSE]Based on the items on the shopping list, create me a nice but not to difficult recipe[/PURPOSE]}}",
    "attributes" : {
      "purposeDescription" : "This object contains the outline of the shopping list. It has the details like the total, the date etc.",
      "referenceId" : "[Replace with the referenceId]",
      "type" : "agentforce1__Shopping_List__c"
    }
  } ]
