## SCHEMA MAPPING PURPOSE DESCRIPTION
Analyse incoming emails related to a case to see if they are actually spam emails. We give them a likely Score and reason on what to check for as well as a status.

## SCHEMA MAPPING JSON OUTPUT FORMAT
{
  "records" : [ {
    "agentforce1__spam_analyses__r" : {
      "records" : [ {
        "agentforce1__Status__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]255[/DATA_LENGTH][PURPOSE]9 or 10 --> \"Passed\"\n6 or 7 or 8 --> \"Check Required\"\n5 or lower --> \"Failed\"\nUse these exact values[/PURPOSE]}}",
        "agentforce1__Spam_Probability_Score__c" : "{{[DATA_TYPE]Number[/DATA_TYPE][DATA_LENGTH]0[/DATA_LENGTH][PURPOSE]Give a spam probability score between 1 and 10. Where 10 is most likely to be spam and 1 is not likely at all[/PURPOSE]}}",
        "agentforce1__Reason_for_score__c" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]32768[/DATA_LENGTH][PURPOSE]Put your reasoning in here on why you gave the score for the spam analysis[/PURPOSE]}}",
        "attributes" : {
          "purposeDescription" : "This object contains results from scanning incoming emails on their likely hood for being spam emails.\r\nMultiple email can be received in the same input data. Create one of these records for each spam email.",
          "referenceId" : "[Replace with the referenceId]",
          "type" : "agentforce1__Spam_Analysis__c"
        }
      } ]
    },
    "Id" : "{{[DATA_TYPE]String[/DATA_TYPE][DATA_LENGTH]18[/DATA_LENGTH][PURPOSE]The Case Id, this is the input from the prompt template.[/PURPOSE]}}",
    "attributes" : {
      "purposeDescription" : "The parent case where related emails are going to be checked and scored on their spam probability",
      "referenceId" : "[Replace with the referenceId]",
      "type" : "Case"
    }
  } ]
}

